def search_text(text, phrase):
    phrasereg = '(?i)\\b'+phrase+'(es|s)?\W'
    phrasehits = len(re.findall(phrasereg,text))
    return phrasehits

def search_answer(text,answer):
    keywords = [word for word in answer.split(" ") if word not in stopwords]
    keyweight = 1./float(len(keywords))
    ans_hits = search_text(text,answer)
    key_hits = 0
    # for word in keywords:
    #     key_hits += search_text(text,word)
    # key_hits = float(key_hits)*keyweight
    # key_hits -= ans_hits
    # print "KEY HITS "+answer +": " + str(key_hits)
    return ans_hits + key_hits

def normalize(lst):
    max_lst = max(lst)
    if max_lst == 0:
        return lst
    for i in range(len(lst)):
        lst[i] = lst[i]/max_lst
    return lst

def best_answer(lst, neg):
    if neg:
        idx = lst.index(min(lst))
    else:
        idx = lst.index(max(lst))
    return 'a'+str(idx+1)

